import React from "react";
import styles from "./Form.module.css";

const Form = () => {
    return ( 
    <div>
        <form action="">
            <label htmlFor="">Username</label>
            <input type="text" />
            <label htmlFor="">Password</label>
            <input type="check" />
            <button>Login</button>
        </form>        
    </div>
    );
};

export default Form;
